import React from "react";
import { Redirect, Route, Switch } from "react-router-dom";
import DCIndex from "../pages/DC";
import CcrIndex from "../pages/logistics/ccr";
import CourierIndex from "../pages/logistics/courier";
import DeliveryChallanIndex from "../pages/logistics/delivery-challan";

import DeliveryChallanBrowse from "../pages/logistics/delivery-challan/browse";
import JobWorkIndex from "../pages/logistics/job-work";
import MrnDcIndex from "../pages/logistics/material-receipt-note";
import ReturnableIndex from "../pages/logistics/returnable-gate-pass";

const Logistics = () => {
  return (
    <div className="container-fluid">
      <Switch>
        <Route path="/logistics/out/sl-dc" exact component={DCIndex} />
        <Route path="/logistics/out/non-sl-dc" exact component={DCIndex} />
        <Route path="/logistics/out/mdc" exact component={DCIndex} />
        <Route path="/logistics/out/sl-wip" exact component={DCIndex} />
        <Route path="/logistics/out/non-sl-wip" exact component={DCIndex} />
        <Route path="/logistics/out/dc-packaging" exact component={DCIndex} />
        <Route path="/logistics/in/mrn-dc" exact component={MrnDcIndex} />
        <Route path="/logistics/in/mrn-po" exact component={MrnDcIndex} />
        <Route path="/logistics/in/mrn-wip" exact component={MrnDcIndex} />
        <Route path="/logistics/rgp" exact component={ReturnableIndex} />
        <Route path="/logistics/rrgp" exact component={ReturnableIndex} />
        <Route path="/logistics/jw/jwi" exact component={JobWorkIndex} />
        <Route path="/logistics/jw/jwo" exact component={JobWorkIndex} />
        <Route path="/logistics/ccr/ccr-in" exact component={CcrIndex} />
        <Route path="/logistics/ccr/ccr-out" exact component={CcrIndex} />
        <Route path="/logistics/courier/in" exact component={CourierIndex} />
        <Route path="/logistics/courier/out" exact component={CourierIndex} />
        <Route path="/logistics/courier/invoice" exact component={CourierIndex} />
        <Route
          path="/logistics/delivery-challan"
          exact
          component={DeliveryChallanIndex}
        />

        <Redirect to="/logistics/dc-packaging" from="/logistics" />
      </Switch>
    </div>
  );
};

export default Logistics;
